import requests, logging
from typing import Optional

def reset_password(user_id: str, new_password: str, api_token: str) -> bool:
    """
    Resets the password for a given user by sending a secure PATCH request.
    Returns True if the operation succeeded, False otherwise.
    """
    url = f"https://api.example.com/users/{user_id}/password"
    headers = {
        "Authorization": f"Bearer {api_token}",
        "Content-Type": "application/json",
    }
    payload = {"password": new_password}
    try:
        response = requests.patch(url, json=payload, headers=headers, timeout=10)
        response.raise_for_status()
        return response.json().get("success", False)
    except requests.RequestException as e:
        logging.error(f"Password reset failed for user {user_id}: {e}")
        return False
